//import dates list from database (php)

	 var available_formatted_dates_list = dates;

	 function check_available_date(date) {
		 var formatted_date = '',
			 ret = [true, "", ""];
		 if (date instanceof Date) {
			 formatted_date = $.datepicker.formatDate('dd-mm-yy', date);

		 } else {
			 formatted_date = '' + date;

		 }
		 if (-1 === available_formatted_dates_list.indexOf(formatted_date)) {
			 ret[0] = false;
			 ret[1] = "date-disabled"; // put yopur custom csc class here for disabled dates
			 ret[2] = "Data jest niedostępna"; // put your custom message <her></her>  e

		 }
		 return ret;
	 }


	 // SCROLL EVENT TO DATE ID
	 function scroll_event(date) {
	 		// var datID = "31-01-2018";
	 		var datID = '#id'+date;
			// 	console.log('funkcja datID='+datID);
	 		$(".item_event").removeClass("item_event_active");
	 		$(".event_container").mCustomScrollbar("scrollTo", datID);
	 		$(datID).delay(1000).addClass("item_event_active");
	 };
	 // SCROLL EVENT TO DATE ID END


	 function getcalender() {
		 $('.date').datepicker({
			 onSelect: function(date) {
				 // alert(date);
				//  var datID = date;
        //  console.log('kalendarz data: '+date);
				 scroll_event(date);
			 },
			 // minDate: 0, //minimu date set
			 maxDate: null, //"+10M +2D", // maksimum date set
			 closeText: "Zamknij",
			 dayNames: ["Niedziela", "Poniedziałek", "Wtorek", "Środa", "Czwartek", "Piątek", "Sobota"],
			 dayNamesMin: ["Nd", "Pn", "Wt", "Śr", "Cz", "Pt", "So"],
			 dayNamesShort: ["Nd", "Pn", "Wt", "Śr", "Cz", "Pt", "So"],
			 monthNames: ["Styczeń", "Luty", "Marzec", "Kwiecień", "Maj", "Czerwiec", "Lipiec", "Sierpień", "Wrzesień", "Październik", "Listopad", "Grudzień"],
			 monthNamesShort: ["Sty", "Lut", "Mar", "Kwi", "Maj", "Cze", "Lip", "Sie", "Wrz", "Paź", "Lis", "Gru"],
			 dateFormat: "dd-mm-yy",
			 navigationAsDateFormat: true,
			 nextText: 'M',
			 prevText: 'M',
			 showOtherMonths: true,
			 multidate: true,
			 duration: "slow",
			 firstDay: 1,
			 gotoCurrent: true,
			 hideIfNoPrevNext: true,
			 dateFormat: 'dd-mm-yy',
			 beforeShowDay: check_available_date,
			 minDate: 0, //minimu date set
		 });

		 // return this;
	 };

	 $(document).ready(function() {
		 // GENERATE CALENDER ON START//
				getcalender();

});




$(document).ready(function(){
	$('#nav-icon2').click(function(){
		$(this).toggleClass('open');
    $('#navbarNav').toggleClass('open-menu')
	});
 $('#navbarNav a').click(function(){
	 $('#nav-icon2').toggleClass('open');
	 $('#navbarNav').toggleClass('open-menu')
 });

});




