$(document).ready(function() {

if ($(window).width() > 991) {

	// DODAWANIE PODKREŚLENIA NA STRONIE GŁÓWNEJ (PRZEŁĄCZANIE MIĘDZY POZYCJAMI STRONY GŁÓWNEJ)


	$('nav a[href*="#"]').click(function(){
	//  $(this).addClass('activeItem');
		$(this).parent().siblings().find('a').delay(2000).removeClass('activeItem');
	});

	// DODAWANIE PODKREŚLENIA NA STRONIE GŁÓWNEJ (PRZEŁĄCZANIE MIĘDZY PODSTRONAMI A STRONĄ GŁÓWNĄ)

	if(window.location.hash) {
			var hash = window.location.hash.substring(1); //Puts hash in variable, and removes the # character
		 //  alert (hash);
			$("nav a[href$="+hash+"]").addClass('activeItem');
	 }

	 // // PŁYNNE PRZEWIJANIE STRONY

   $('a[href^="#"]').on('click', function(event) {

 		var target = $( $(this).attr('href') );

 		if( target.length ) {
 			event.preventDefault();
 			$('html, body').animate({
 				scrollTop: target.offset().top
 			}, 1000);
 		}
 	});

// DODAWANIE PODKREŚLENIA PRZY SCROLLU

$.fn.isInViewport = function() {
  var elementTop = $(this).offset().top+500;
  var elementBottom = elementTop + $(this).outerHeight();

  var viewportTop = $(window).scrollTop();
  var viewportBottom = viewportTop + $(window).height();

  return elementBottom > viewportTop && elementTop < viewportBottom;
};

$(window).on('resize scroll', function() {
	var $document = $(document)
 if ($document.scrollTop() >= 500) {
$('#menu-menu-glowne #menu-home a').removeClass('activeItem');
 };

  $('.interactiveItem').each(function() {
      var activeItem = $(this).attr('id');
    if ($(this).isInViewport()) {

      $('#menu-menu-glowne li a.dynamicItem').delay(2000).removeClass('activeItem');
      $('#menu-' + activeItem+'  a').addClass('activeItem');
    }


  });
});


};
});
//
//



// Instantiate the Bootstrap carousel
// $('.multi-item-carousel').carousel({
//   interval: false;
// });

// for every slide in carousel, copy the next slide's item in the slide.
// Do the same for the next, next item.
$('.multi-item-carousel .item').each(function(){
  var next = $(this).next();
  if (!next.length) {
    next = $(this).siblings(':first');
  }
  next.children(':first-child').clone().appendTo($(this));

  if (next.next().length>0) {
    next.next().children(':first-child').clone().appendTo($(this));
  } else {
  	$(this).siblings(':first').children(':first-child').clone().appendTo($(this));
  }
});
